import "./toggle.css"
import React from 'react';
import Sun from "../../img/9.png"
import Moon from "../../img/5.png"
const Toggle = () => {
    return (
        <div className="t">
            <img src={Sun} alt=""/>
            <img src={Moon} alt=""/>
            <button className="t-button"> </button>
        </div>
    );
};

export default Toggle;
